Portrait of actress @belpowley photographed by the helper’s staircase at The Anne Frank House in Amsterdam. @annefrankhouse_official for @natgeo @natgeotv 

For the series premiere of “A Small Light,” I traveled to Amsterdam and traced what might have been a routine day for Miep Gies, the young woman who helped hide Anne Frank and her family during World War II and later saved the teen’s journals. I began at the family’s original home, then made my way across the city, stopping and taking photographs at various places that Gies had frequented. Although many of these shops and bookstores no longer exist, it was extremely powerful to follow her path and imagine her days as she ran errands and navigated her life during these perilous times.

